text:
@DavidHenigUK @DominicRaab @HenryNewman @BBCr4today Out of interest, why do you say they are weak, David? Don't they go significantly further than previous LPF provisions insofar as they
(a) peg the UK to EU, not intl standards
(b) are enforceable via the operation of dispute resolution on domestic enforcement processes?

@DominicRaab @BBCr4today We disagree

There's certainly (&amp; unsurprisingly) level-playing field rules. But other than state aid no harmonisation - just non-regression with no dispute resolution. Some level playing field would be price of any deal

Don't see how that's Single Market obligations of Norway

@EFTA4UK @DominicRaab @BBCr4today You don't in backstop. 

There would be increased SPS checks across Irish Sea &amp; in market checks on goods regulations. 

NI in a quasi-Single Market for goods. Rest of UK firmly out
